(52, 'about_block1_image', 'about_block1_image_6b6212a0bd4a463fe48ec32df635a4bc.png', 3),
(53, 'about_block1_text', '<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;Свадебный журнал The ONE &mdash; абсолютно новый и уникальный как по форме, так и по содержанию.<br />\r\n&nbsp;Это журнал для современных, амбициозных девушек, с прекрасным вкусом, знаниями и интеллектом.</p>\r\n', 3),
(54, 'about_block4_image', 'about_block4_image_b19e21a3d6e98c08d945d6a25a385a9a.jpg', 3),
(55, 'about_block2_heading', 'О чём наш журнал?', 3),
(56, 'about_block2_text', '<p>&nbsp;The ONE &mdash; дизайнерское, &laquo;умное&raquo; издание, которое уважает своего читателя, хочет быть ему полезным, интересным, вдохновлять на творчество, заставляет задуматься и улыбнуться.</p>\r\n', 3),
(57, 'about_block3_image', 'about_block3_image_6025ededa74f073652a04236d27c1b65.jpg', 3),
(58, 'about_block3_heading', 'В журнале вы найдете?', 3),
(59, 'about_block3_text', '<p>&nbsp;</p>\r\n\r\n<p>&nbsp;В журнале представлены интервью и советы от мировых Гуру флористики и декора, последние тренды и новинки, самые яркие события, &laquo;живые&raquo; свадьбы, креативные идее, профессиональные мастер-классы, беседы со знаменитостями и авторские инсталляции.</p>\r\n', 3),
(60, 'about_block4_heading', 'Немного истории', 3),
(61, 'about_block4_text', '<p>&nbsp;Журнал The ONE не имеет аналогов ни в Украине, ни за ее пределами. На рынке Украины он появился два года назад и с того момента стремительно набирает высоту, при этом, с каждым выпуском только поднимая планку. За это время он заслужил репутацию творческого и неординарного издания и получил высокую оценку у именитых профессионалов со всего мира. Он издается на двух языках: русском и английском, таким образом, охватывая широчайшую аудиторию множества стран. В 2015 году The ONE официально стал торговой маркой.</p>\r\n\r\n<p><br />\r\n&nbsp;The ONE перевернет ваше сознание, научит смотреть на мир другими глазами, видеть необычное в обычном, замечать красоту во всем! The ONE умеет и будет вас удивлять!</p>\r\n', 3),
